      .then((res) => res.json())
      .then((response: Stashpoint[]) => {
        let result: Stashpoint[] = response
        console.log(result)
        // setStachList(result)
      })
      .catch((err) => console.log(err))
  }, [])

  return (
    <div>
      <h1>Home</h1>
    </div>
  )
}

export default Home
